(5, 'Alan', 'Claude', 'Alan Claude 2', 'alan-claude-2', 'info@alanclaude.com', '+12075820530', 'Graphic Artist', 'user-1698762139.png', 'artist-logo-1699782883.png', 'Inspired by bold, Poster Style graphics from the 1920’s and 30’s, mixed in with a little Edward Hopper, a heap of drama and a teaspoon of serenity, Alan Claude’s art calmly reflects the beauty of coastal life. Overlooking the Kennebec River, the Alan Claude Gallery is located in historic downtown Gardiner, Maine. Alan Claude’s Poster Style art of lighthouses, coastal and la', '165 Water Street', NULL, '04345', 'Gardiner', 3919, 231, 'https://alanclaude.com/', 0, 1, 4, 1, '2023-10-03 10:41:53', '2024-04-16 07:16:40'),
(6, 'Kate', 'Nelligan', 'display name', 'display-name', 'info@shoplocalcolor.com', '+12072040704', 'Kate Nelligan Design', 'user-1698762154.png', 'artist-logo-1703836008.png', 'Kate is best known for her colorful graphic designs originating from cut paper collages and block prints. Her coastal designs and patterns are reminiscent of summers in her favorite place, her home town of Kennebunkport, Maine. For many years, she worked as a product designer developing collections for the gift and home d&eacute;cor markets until launching her own design collection,', '30 Dock Square', NULL, '04046', 'Kennebunkport', 3919, 231, 'https://www.katenelligandesign.com/', 0, 1, 16, 1, '2023-10-03 10:43:53', '2024-04-16 07:16:40'),
(7, 'Sirpa', 'Cowell', 'Sirpa Cowell 3', 'sirpa-cowell-3', '1235@1234.es', '+358412345678', 'International Designer', 'user-1698762173.png', 'artist-logo-1703786345.png', 'Sirpa is an accomplished international designer from Finland. Her body of work from textiles to apparel to commercial design and fine artwork is rooted in nature, evident through her organic patterns, vibrant color palettes and varied subject matter. Her paintings, prints and photographs reflect her Scandinavian ideals of balance, simplicity, and warmth, combined with her signature element of joy.', '1234 St', NULL, '123456', '1234', 1151, 74, '1234.com', 0, 1, 20, 1, '2023-10-04 04:43:47', '2024-04-16 07:16:40'),
(8, 'Jon', 'Kit', 'Jon', 'jon', 'v12@zl5y.com', '+923462121123', 'Tray designer', 'artist-photo1698123099.png', NULL, '<p>Creating a designer can be a complex and resource-intensive task, so it&#39;s important to have a clear plan and the necessary technical expertise to bring your vision to life.</p>', 'pakistan town phase 1', NULL, '44000', 'islamabad', 2723, 166, 'website.com', 1, 1, 0, 2, '2023-10-24 04:51:39', '2024-03-12 11:00:00'),
(9, 'Betsy', 'Barry', 'Betsy Barry', 'betsy-barry', '1234@1234.es', '+12818257821', 'Betsy Barry Art & Designs', 'artist-photo1699780241.png', 'artist-logo-1706007195.png', 'Working in colored pencils on paper, Betsy captures the beauty of everyday objects and creates works of art that capture the essence of her pieces. Botanical and nautical subjects are her main inspirations. She can often be found sharing her passion by teaching others her techniques at local garden centers and farms or working on a new design in her sketchbook by the ocean. &ldquo;Colored Pencil o', '48 W Main St', NULL, '06355', 'Mystic', 3919, 231, 'https://www.betsybarry.com/', 0, 1, 11, 1, '2023-10-31 09:39:55', '2024-04-16 07:16:40'),
(10, 'Alyssa', 'Watters', 'Alyssa Watters', 'alyssa-watters', 'test@test.com', '+16502090834', 'Alyssa Watters', 'artist-photo1698811282.jpg', 'artist-logo-1700388276.png', 'Art by Alyssa was founded in&nbsp;2010 by Alyssa Watters.&nbsp;A company created to bring&nbsp;happiness and color to your&nbsp;everyday life. Alyssa&rsquo;s work&nbsp;reflects her love for travel,&nbsp;gardening, nature and fun. Her&nbsp;popular line of gifts and stationery has&nbsp;appeared in hundreds of independent&nbsp;boutiques around the country.', '85 T J Gamester Avenue', NULL, '03801', 'Portsmouth', 3919, 231, '', 0, 1, 10, 1, '2023-11-01 04:01:22', '2024-04-16 07:16:40'),
(11, 'Sara', 'Trays4Us', 'Trays4Us', 'trays4us', 'test@test.com', '+16502090834', '', NULL, 'artist-logo-1699350946.png', '<p>TEST Working in colored pencils on paper, Betsy captures the beauty of everyday objects and creates works of art that capture the essence of her pieces. Botanical and nautical subjects are her main inspirations. She can often be found sharing her passion by teaching others her techniques at local garden centers and farms or working on a new design in her sketchbook by the ocean. &ldquo;Colored Pencil offers me the ability to capture not only the colors and textures of my subjects, but the details...</p>', '85 T J Gamester Avenue', NULL, '03801', 'Portsmouth', 3919, 231, '', 1, 1, 0, 2, '2023-11-02 03:59:14', '2024-03-12 11:00:01'),
(12, 'Muhammad', 'Azeem', 'Azeem', 'azeem', 'rsfasf@hotmail.com', '+657657657765', 'Hammani Tech', NULL, '', '<p>gjghkjytg</p>', 'ghfgjfgjfhj', NULL, '44000', 'Rawalpindi', 2723, 166, '', 0, 1, 0, 2, '2023-11-06 08:00:42', '2024-03-12 11:00:01'),
(13, 'tesst', 'tesst', 'tesst', 'tesst', '6666@6666.es', '+34666666666', 'tesst', 'artist-photo1699351699.png', 'artist-logo-1699351700.png', '<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum</p>', '6666, 6666 St', NULL, '28001', 'Madrid', 3297, 205, '6666.es', 1, 1, 0, 2, '2023-11-07 10:08:20', '2024-03-12 11:00:01'),
(14, 'Mary', 'Skerrett Koff', 'Lakebound', 'lakebound', 'mary@lakebound.org', '+16502090834', 'Lakebound', 'artist-photo1699372407.png', 'artist-logo-1699782809.png', 'We have powerful memories&nbsp;of being at the lake: summers&nbsp;learning to water ski, sleep-away&nbsp;camp, cliff jumping, being at the&nbsp;cabin, the smell of the shady&nbsp;coves and bays, the lazy days&nbsp;melting into warm evenings,&nbsp;and fall after the crowds leave.&nbsp;For us, there&rsquo;s something about&nbsp;the lake that&rsquo;s like nowhere else.&nbsp;We slow down and let go. A', '85 T J Gamester Avenue', NULL, '03801', 'Portsmouth', 3919, 231, 'https://wearelakebound.com/', 0, 1, 17, 1, '2023-11-07 15:52:51', '2024-04-16 07:16:40'),
(15, 'Elizabeth', 'Pyle', 'Bottle Branch', 'bottle-branch', '6666@6666.es', '+34666666666', 'Bottle Branch', 'artist-photo1699779212.png', 'artist-logo-1699782797.png', 'Welcome to Bottle Branch where Elizabeth shares her love for flowers, plants, nature, gardening, making things, and papergoods. After a career as a botanist Elizabeth fell in love with botanical photography. Her passion inspired her to create Bottle Branch. The hours spent there were filled with wonder, possibility and deep connection to the natural world &ndash; just the sort of connection and in', '6666 St', NULL, '29000', 'city', 3919, 231, '6666.es', 0, 1, 12, 1, '2023-11-10 09:31:16', '2024-04-16 07:16:40'),
(16, 'Janet E.', 'Cook', 'Janet E. Cook', 'janet-e-cook', '6666@6666.es', '+34666666666', 'Janet E. Cook', 'artist-photo1699779782.png', 'artist-logo-1699782774.png', 'Artist and owner of The Dry Dock, Janet E. Cook finds inspiration along the Maine coast. She paints landscapes and portraits that are colorful and realistic with a touch of Impressionism.&rdquo;Painting for me is a meditation, a union of impulse and intellect. Whether my subject is landscape, still life or portrait, I strive to tell an attractive little story which will be read at a single glance,', '6666 St', NULL, '28000', 'city', 3919, 231, '6666.es', 0, 1, 15, 1, '2023-11-10 09:34:20', '2024-04-16 07:16:40'),
(17, 'Cindy', 'Hendrick', 'Woodfield Press', 'woodfield-press', '6666@6666.es', '+34666666666', 'Woodfield Press', 'artist-photo1699778936.png', 'artist-logo-1699782757.png', 'All Woodfield Press artwork is created by Cindy Hendrick . She uses pen and ink and watercolors to create her images. Her settings are taken from the New England woodland and coastal landscape and show her love of nature, gardening, and the animals that frequent her environment.', '6666 St', NULL, '28000', 'city', 3919, 231, '6666.es', 0, 1, 19, 1, '2023-11-10 09:38:31', '2024-04-16 07:16:40'),
(18, 'Eva', 'Lea', 'Tonson kha', 'eva-lea-2', '6666@6666.es', '+34666666666', 'Eva-Lea Design Studio', 'artist-photo1699779972.png', 'artist-logo-1699782673.png', 'Every year, I eagerly wait for the sound of the first fat blueberry hitting the bottom of the galvanized bucket with a satisfying “ping.” This is my happy place where sunshine, blue skies, the mountain, and row upon row of blueberries spread out before me. Time stands still as I daydream of all the ways these blueberries will brighten my days through the fall, winter, and spring.', '6666 St', NULL, '28000', 'city', 3919, 231, '6666.es', 1, 1, 14, 1, '2023-11-10 09:44:07', '2024-10-30 06:19:48'),
(19, 'Sara', 'Fitz', 'Sara Fitz 4', 'sara-fitz-4', '6666@6666.es', '+34666666666', 'Sara Fitz', 'artist-photo1699986305.png', 'artist-logo-1699986305.png', 'Inspired by summers on Nantucket Island, and brought to life along the coast of Maine, Sara Fitz™ offers the region’s iconic style to you. Whether it be a framed life jacket print, sailboat patterned wallpaper, or the sweetest hydrangea covered tote bag, watercolor artist, Sara Fitzgerald O’Brien, celebrates the beauty of the everyday in her collections of illustrated goods.', '6666 St', NULL, '2800', 'city', 3919, 231, '6666.es', 1, 1, 18, 1, '2023-11-14 18:25:05', '2024-04-16 07:16:40'),
(20, 'First', 'Surname', 'Display name', 'display-name-1', 'niklas.lyback@gmail.com', '+14087593610', 'Company', 'artist-photo1704201455.png', 'artist-logo-1704201455.png', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. In arcu cursus euismod quis viverra nibh. Aliquam eleifend mi in nulla posuere sollicitudin aliquam. Vivamus at augue eget arcu. Ut tristique et egestas quis. Accumsan in nisl nisi scelerisque eu ultrices vitae auctor eu. Sem et tortor consequat id porta nibh venenatis', '711 Bayview way', NULL, '94062', 'Emerald Hills', 3919, 231, 'www.test.com', 0, 1, 13, 0, '2023-11-21 15:45:06', '2024-04-16 07:16:40'),
(21, 'Kristine', 'Cooper', 'Kristine Cooper', 'kristine-cooper', 'info@cooperartandabode.com', NULL, '', 'artist-photo1706280169.jpg', 'artist-logo-1706007495.png', 'Kristine Cooper creates vibrant bold landscapes that pull you into the adventure of the Pacific Northwest. She dreams up her designs while hiking, paddleboarding and exploring the wonder of the great outdoors. Each painting was created with intention and story, and her desire is that the art brings the magic of nature home. Kristine works as a full-time artist in her studio in Bend, Oregon.', '8984 SW Pasture CT', NULL, '97760', 'Terrebonne', 3919, 231, 'cooperartandabode.com', 1, 1, 8, 1, '2024-01-20 23:11:48', '2024-04-16 07:16:40'),
(22, 'Anne', 'Kilham', 'Anne Kilham', 'anne-kilham', 'mason@penandincgifts.com', '+12072484542', '', 'artist-photo1705894099.jpg', 'artist-logo-1706008883.png', 'Rockport, Maine has been home for Anne Kilham and her family since 1972. She started her business with handprinted block print notes and postcards that she sold by retail mail order and to local shops. Eventually she moved on to watercolors that capture images of the coast and the islands, inland mountains and lakes, and of course flower gardens.', '15 Darin Drive', NULL, '04330', 'Augusta', 3919, 231, 'jsmccarthy.com', 0, 1, 9, 1, '2024-01-22 03:28:19', '2024-04-16 07:16:40'),
